import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Container, Row, Col} from 'react-bootstrap';
import { useParams } from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import NavSc from '../componentes/navbar';
import Bootfooter from '../componentes/BSfooter';
import Card from 'react-bootstrap/Card';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import '../componentes/style.css';


function Salasmod() {
  
  const { id } = useParams();
  const [sala, setFormData] = useState([]);
  
  useEffect(() => {
      async function fetchFormData () {
      
      try {
        
        console.log('id =' + id);
        const response = await axios.get(`http://localhost:2527/api/fndsalas/${id}`);
        setFormData(response.data);      
        console.log('response ' + response.data);
      } catch (error) {
        console.error(error);
      }
  
      };
      fetchFormData();
    },[id]); 
  
  return (    

    <Container>

      <NavSc/>

      <Card>
        <Card.Img className='doriana' variant="top" src={sala.imgsala} />
      <Card.Body>
        <Form className="d-flex">
      <Row>
      <Col>
      <Form.Group className="me-2" controlId="formBasicEmail">
        <Form.Label>Descrição:</Form.Label>
        <Form.Control type="text" placeholder="" value={sala.descricao}/>
      </Form.Group>
      </Col>
      </Row>
      <Row>
      <Col>
      <Form.Group className="me-2" controlId="formBasicPassword">
        <Form.Label>Número da Sala:</Form.Label>
        <Form.Control type="text" placeholder="Password" value={sala.numero}/>
      </Form.Group>
      </Col>
      </Row>
      <Row>
      <Col>
      <Form.Group className="me-2" controlId="formBasicPassword">
        <Form.Label>Capacidade da Sala:</Form.Label>
        <Form.Control type="text" placeholder="Password" value={sala.capacidade}/>
      </Form.Group>
      </Col>
      </Row>
      <Row>
      <Col>
      <Form.Group className="me-2" controlId="formBasicPassword">
        <Form.Label>Valor da Sala:</Form.Label>
        <Form.Control type="text" placeholder="Password" value={sala.valor}/>
      </Form.Group>
      </Col>
      </Row>
      <Row>
      <Col>
      <Form.Group className="me-2" controlId="formBasicPassword">
        <Form.Label>Link da imagem da Sala:</Form.Label>
        <Form.Control type="text" placeholder="Password" value={sala.imgsala}/>
      </Form.Group>
      </Col>
      </Row>
      <Row>
      <Col>
      <Form.Group className="me-2" controlId="formBasicCheckbox">
        <Form.Check type="checkbox" label="Check me out" />
      </Form.Group>
      <Button variant="dark" type="submit">
        Submit
      </Button>
      </Col>
      </Row>
      </Form>
      </Card.Body>
      </Card>
      
      <Bootfooter/>

    </Container>
  );
}

export default Salasmod;
